INSERT INTO `alimento` (`id`, `nombre`, `descripcion`, `idtalimento`, `valor`, `iva`, `bitactivo`) VALUES
(1, 'Almojábana', 'Almojábana 50 gr (2 unidades) y Jugo caja tetra pack  o doy - pack, preferiblente de marca tutifruti, hit o similar calidad malta o gaseosa, cantidad: 1 und x 200 ml.', '1', '2951', '16', 1),
(2, 'Arepa de chocolo', 'Arepa de Chocolo 150 gr con quesito 60 gr y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidadmalta o gaseosa, cantidad: 1 und x 200 ml o con Café con leche o con chocolate con leche 12 onzas.', '1', '2989', '16', 1),
(3, 'Buñuelos', 'Buñuelos (2 unidades de 50 gr/cu) y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad malta o gaseosa, cantidad: 1 und x 200 ml.', '1', '2857', '16', 1),
(4, 'Croissant de jamón y queso ', 'Croissant de Jamón y Queso  120 gms y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidadmalta o gaseosa, cantidad: 1 und x 200 ml o con Café con leche o con chocolate con leche 12 onzas.', '1', '2331', '16', 1),
