(6, 'Empanada Chilena', 'Empanada Argentina de 130 gr y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad malta o gaseosa, cantidad: 1 und x 200 ml.', '1', '3392', '16', 1),
(7, 'Empanada hojaldrada pollo y verduras', 'Empanada hojaldrada de 130 gr, relleno (equivale a 90 gms de los 130 gms totales) de pollo y verduras, aderezado con salsa y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200ml', '1', '3106', '16', 1),
(8, 'Empanadas típicas', 'Empanadas típicas de 50 gr (3 unidades), encurtido o salsa y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200ml o con Café con leche o chocolate con leche de 12 onzas.', '1', '2872', '16', 1),
(9, 'Almojábana ', 'Almojábana 50 gr (1 unidad), yogur presentación bolsa de 200cc, granadilla y chocolatina de 12 g.ar calidad: 1 und x 200 ml.', '1', '2889', '16', 1),
(10, 'Pastel de  carne con verduras en hojaldre', 'Pastel de  carne con verduras en hojaldre: 1 und x 120 gr, con salsa showy de 10 gr,  Jugo de guayaba, caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200 cc, banano y nusita.', '1', '3555', '16', 1),
(11, 'Empanada de pollo con verduras  en hojaldre', 'Jugo de mango, caja tetra pack preferiblente de marca tutifruti o de similar calidad presentación de 200 cc. Empanada hojaldrada de 130 gr, relleno de pollo y verduras, cinco uvas chilenas y chocolatina 12 gr.', '1', '3644', '16', 1),
(12, 'Arepa de chocolo', 'Arepa de Chocolo 150 gr con quesito 60 gr, pera  y panelita de coco y arequipe, Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidadmalta o gaseosa, cantidad: 1 und x 200 cc', '1', '3688', '16', 1),
(13, 'Brownie ', 'Brownie relleno de arequipe, Jugo de guayaba, caja tetra pack preferiblente de marca tutifruti o de similar calidad presentación de 200 cc, manzana pequeña.', '1', '3555', '16', 1),
(14, 'Palito de queso con centro de guayaba hojaldrado', 'Palito de queso 120 gr, con centro de guayaba hojaldrado y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad malta o gaseosa, cantidad: 1 und x 200 ml.', '1', '2294', '16', 1),
(15, 'Palito de queso frito', 'Palito de queso frito: 1 und x 120 gr y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200ml.', '1', '2358', '16', 1),
(16, 'Palito de queso masa hojaldrada', 'Palito de queso masa hojaldrada 120 gr: 1 und y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad, malta o gaseosa, cantidad: 1 und x 200 ml ', '1', '2307', '16', 1),
