(20, 'Pastel de pollo o carne con verduras en hojaldre', 'Pastel de pollo o carne con verduras en hojaldre: 1 und x 120 gr y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200ml.', '1', '2959', '16', 1),
