(22, 'Pastel de pollo o carne en masa frito', 'Pastel de pollo o carne en masa frito: 1 und x 120 gr, encurtido o salsa y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200ml.', '1', '2597', '16', 1),
