(24, 'Pinchos de pollo apanado (Especial)', 'Pinchos de pollo apanado (2 unidades) 120 gr, papas a la francesa 50 gr, arepa y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200 ml o con Café con leche o chocolate con leche de 12 onzas.', '1', '3469', '16', 1),
(25, 'Porción de torta', 'Porción de torta 100 gr (naranja, brevas, zanahoria, otras) y Jugo caja tetra pack preferiblente de marca tutifruti o de similar calidad: 1 und x 200 ml.', '1', '2470', '16', 1),
(26, 'Salpicón 10 onzas', 'Salpicón 15 onzas, con helado dos bolas de 30 gr c/u, crema chantilly 30 gr, barquillo y galleta', '1', '3376', '16', 1),
(27, 'Sanduche especial pan Alemán', 'Sánduche especial de pan alemán, con doble porción de jamón (44 gr), doble porción de queso (60 gr), vegetales frescos 80 gr (tomate, lechugarizada), pasta jamonada 40 gr, aderezados con salsa de ciruelas u otra a elcción 20 gr y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad, malta o gaseosa, cantidad: 1 und x 200 cc', '1', '4309', '16', 1),
(28, 'Sánduche integral a 3 panes', 'Sánduche integral a 3 panes, con relleno de jamón de 44 gr, en salsa americana, acompañado por otro piso de mezcla de quesos 50 gr, y Jugo caja tetra pack o doy-pack, preferiblente de marca tutifruti o de similar calidad: 1 und x 200 ml o con Café con leche o chocolate con leche de 12 onzas.', '1', '3609', '16', 1),
(29, 'Sanduche pan Danés', 'Sanduche Conformado por: Pan Danés : 1 und x 160 gr, Jamón de primera calidad:  tajadas de 44 gr, Queso mozarella de primera calidad: 2 tajada x 30 gr c/u,  Sobre salsa rosada: 10 gr, verduras (tomate, cebolla, lechuga crespa 80 gr y Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad, malta o gaseosa, cantidad: 1 und x 200 cc', '1', '3376', '16', 1),
(30, 'Tortillas de pan Árabe', 'Tortillas de pan árabe, rellenas en su interior con jamón 44 gr, queso 60 gr, pasta mizo 60 gr, verduras 80 gr, aderezadas con salsa alioli 20 gr y Jugo caja tetra pack o doy-pack, preferiblente de marca tutifruti o de similar calidad: 1 und x 200 ml o con Café con leche o chocolate con leche de 12 onzas.', '1', '4969', '16', 1),
(31, 'Refrigerio navideño', 'Refrigerio navideño: Natilla de 100 gr, 2 buñuelos de 40 gr c/u, hojuela de 40 gr, jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad, malta o gaseosa, cantidad: 1 und x 200 cc.  En su empaque navideño.', '1', '3367', '16', 1),
(32, 'Refrigerio navideño especial', 'Refrigerio navideño especial: Natilla de 80 gr, Manjar blanco de 8 gr, buñuelo de 30 gr, hojuela de 20 gr, brauny de 20 gr, 3 galletas navideñas, Jugo caja tetra pack o doy - pack, preferiblente de marca tutifruti, hit o similar calidad, malta o gaseosa, cantidad: 1 und x 200 cc.  Presentado en empaque navideño apropidado para la ocasión.', '1', '4553', '16', 1),
