(101, 'Menú 1 con Frijoles', 'Frijoles: 1 porción x 300 gr; Arroz: 1 porción x 110 gr en cocido; Chicharrón carnudo: 1 porción x 100 gr en cocido; Huevo cocido o frito: 1 unid tipo A; Patacón: 1 unid x 60 gr; Arepa redonda: 1 unid x 40 gr; Postre: 1 porción x 40 gr; Jugo de fruta en empaque individual tetrapack: 1 porción x 200 cc. Todos los gramajes son en cocido.', '2', '6789', '16', 1),
(102, 'Menú 2 con Sopa', 'Sopa de verduras o cremas de ahuyama: 1 porción x 300 gr; Carne de cerdo (Cortes: cañón o lomo o solomo) o res cortes: Lomos o punta de anca): 1 porción x 110 gr en cocido, corte de primera; Arroz: 1 porción x 120 gr en cocido; Acompañante a base de papa o yuca: 1 porción x 100 gr en cocido; Ensalada con vinagreta: 1 porción x 100 gr; Jugo de fruta en empaque individual tetrapack: 1 porción x 200 cc.; Postre: 1 porción x 40 gr. Todos los gramajes son en cocido.', '2', '6509', '16', 1),
(103, 'Menú 3 con Sopa', 'Sopa o crema sabor a elecció: 1 porción x 300 gr, Carne asada de cerdo (Cortes: cañón o lomo o solomo) o res (cortes: Lomos o punta de anca): 1 porción x 110 gr en cocido, corte de primera; Arroz: 1 porción x 120 gr en cocido. Acompañante de papa o yuca: 1 porción x 100 gr; Ensalada con base de lechuga con vinagreta: 1 porción x 100gr; Arepa redonda 1 unid x 40 gr; Postre: 1 porción x 40 gr; Jugo de fruta en empaque individual tetrapack: 1 porción x 200 cc. Todos los gramajes son en cocido.', '2', '6688', '16', 1),
(104, 'Menú 4 con Carne', 'Carne: 1 porción x 110 gr en cocido, de muchacho en salsa de champiñones; Puré al gratín: 1 porción x 90 gr; Arroz con verduras: 1 porción x 120 gr; ensalada verde con vinagreta: 1 porción x 100 gr; Pan tipo buffet: 1 und x 30gr; Postre: 1 porción x 40 gr (mousse de limón o mora); Jugo de fruta en empaque individual tetrapack : 1 porción x 200 cc. En buffet no incluye meseros, todos los gramajes son en cocido.', '2', '9271', '16', 1),
(105, 'Menú 5 con Chuleta', 'Carne: 1 porción x 150 gr en cocido, de chuleta de cerdo con salsa BBQ; Papa rayada cocida y gratinada: 1 porción x 100 gr; Arroz especial (con maicitos, tocineta y pimentón): 1 porción x 160 gr; ensalada cesar: 1 porción x 100 gr; postre torta de manzana: 1 porción x 80 gr; Jugo de fruta en empaque individual tetrapack: 1 porción x 200 cc. En buffet no incluye meseros, todos los gramajes son en cocido.', '2', '9533', '16', 1),
